import React from 'react';
import AppLayout from '../components/AppLayout';
import Head from 'next/head';

const Home = () => {
  return (
    <>
      <Head>
        <meta charSet="utf-8"/>
        <title> 여긴 메인 </title>
      </Head>
      <AppLayout>
        <dev> Hello, Next!</dev>
      </AppLayout>
    </>
  );
}

export default Home;
